Because no depreciation was carried in before (thus the accumulated depreciation “initial value” is zero) the only movement in this account is the depreciation expense item added on 2024‑01‑01. That amount is given as 45749.759999999995 (which rounded to two decimals becomes 45749.76). Hence the accumulated depreciation at period end is simply the sum of what was recorded during the period, that is, 45749.76.

